import React from 'react';
import { ResponsiveContainer } from 'recharts';
import Title from './Title';

export default function adminServices() {

    return (
        <React.Fragment>
          <Title>Today</Title>
          <ResponsiveContainer>
            <li
              margin={{
                top: 16,
                right: 16,
                bottom: 0,
                left: 45,
              }}
            >
                <a href="https://localhost:8080">localhost</a>
                <a href="https://localohst:9000">9000</a>
            </li>
          </ResponsiveContainer>
        </React.Fragment>
      );
}
